/**
 * return config object
 *
 * @param {Object} AWS AWS SDK module
 * @param {Function[]} getters function list
 * @param {Object} opts options
 * @return {Object}
 */
export default function configProvider(AWS, getters, opts = {}) {
  let config = {region: undefined};
  for (const getter of getters) {
    config = getter(config, AWS, opts);
  }
  return config;
}

/**
 * return config object load from environment variables.
 *
 * @param {Object} config config object
 * @return {Object}
 */
export default function environmentConfigs(config) {
  const region = process.env.AWS_REGION || process.env.AMAZON_REGION;
  if (region) {
    return Object.assign({}, config, {region});
  }
  return config;
}

import path from 'path';

import osHomeDir from 'os-homedir';


/**
 * return default config file path
 *
 * @return {string|null}
 */
function getDefaultConfigFile() {
  const homedir = osHomeDir();
  return homedir && path.join(homedir, '.aws', 'config');
}


/**
 * return config object load from config file.
 *
 * @param {Object} config config object
 * @param {Object} AWS AWS SDK module
 * @param {Object} opts options
 * @param {string} opts.profile profile name
 * @param {string} opts.configFile config file path
 * @return {Object}
 */
export default function fileConfigs(config, AWS, opts = {}) {
  const filename = opts.configFile || process.env.AWS_CONFIG_FILE || getDefaultConfigFile();
  if (!filename) {
    return config;
  }
  const prof = opts.profile || process.env.AWS_PROFILE || 'default';
  try {
    const conf = AWS.util.ini.parse(AWS.util.readFileSync(filename))[prof];
    if (typeof conf === 'object' && conf.region) {
      return Object.assign({}, config, {region: conf.region});
    }
    return config;
  } catch (err) {
    return config;
  }
}

import environmentConfigs from './configs/environmentConfigs';
import fileConfigs from './configs/fileConfigs';
import configProvider from './configProvider';

/**
 * initialize AWS.config using regionProvider
 *
 * @param {Object} AWS AWS SDK module
 * @param {Object} opts options
 * @param {string} opts.profile profile name
 * @param {boolean} opts.noReflectCredentials opts.profile doesnot reflect credentials
 */
export default function loader(AWS, opts = {}) {
  AWS.util.update(AWS.Config.prototype.keys, configProvider(AWS, [
    fileConfigs,
    environmentConfigs
  ], opts));
  if (!opts.noReflectCredentials) {
    AWS.util.update(AWS.Config.prototype.keys, {
      credentials: () => {
        let credentials = null;
        new AWS.CredentialProviderChain([
          () => new AWS.EnvironmentCredentials('AWS'),
          () => new AWS.EnvironmentCredentials('AMAZON'),
          () => new AWS.SharedIniFileCredentials({profile: opts.profile})
        ]).resolve((err, creds) => {
          if (!err) {
            credentials = creds;
          }
        });
        return credentials;
      }
    });
  }
  AWS.config = new AWS.Config();
}

import AWS from 'aws-sdk';
import assert from 'power-assert';
import sinon from 'sinon';

import configProvider from '../src/configProvider';


/** @test {configProvider} */
describe('configProvider()', () => {
  it('when apply multiple getteres return overriden config', () => {
    const getters = [
      config => config,
      config => Object.assign({}, config, {region: 'foo'}),
      config => config,
      config => Object.assign({}, config, {region: 'bar'})
    ];
    assert.deepEqual(configProvider(AWS, getters), {region: 'bar'});
  });

  it('when doesnot apply getters return default config', () => {
    assert.deepEqual(configProvider(AWS, []), {region: undefined});
  });

  it('when apply options getter args applied options', () => {
    const spy = sinon.spy(config => config);
    const getters = [spy];
    const opts = {profile: 'buz'};
    assert.deepEqual(configProvider(AWS, getters, opts), {region: undefined});
    assert(spy.args.length === 1);
    assert.deepEqual(spy.args[0], [
      {region: undefined},
      AWS,
      opts
    ]);
  });
});

import assert from 'power-assert';

import environmentConfigs from '../../src/configs/environmentConfigs';
import {resetEnv} from '../helpers';


/** @test {environmentConfigs} */
describe('environmentConfigs()', () => {
  let defaultConfig = null;
  beforeEach(() => {
    resetEnv();
    defaultConfig = {region: undefined};
  });
  afterEach(resetEnv);

  it('when no specific env return default config', () => {
    assert.deepEqual(environmentConfigs(defaultConfig), {region: undefined});
  });

  it('when env.AWS_REGION exists return overriden config', () => {
    process.env.AWS_REGION = 'foo';
    assert.deepEqual(environmentConfigs(defaultConfig), {region: 'foo'});
  });

  it('when env.AMAZON_REGION exists return overriden config', () => {
    process.env.AMAZON_REGION = 'bar';
    assert.deepEqual(environmentConfigs(defaultConfig), {region: 'bar'});
  });

  it('when AMAZON_REGION and AWS_REGION exists return overriden config by AWS_REGION', () => {
    process.env.AWS_REGION = 'foo';
    process.env.AMAZON_REGION = 'bar';
    assert.deepEqual(environmentConfigs(defaultConfig), {region: 'foo'});
  });
});

import path from 'path';

import AWS from 'aws-sdk';
import assert from 'power-assert';
import proxyquire from 'proxyquire';

import {resetEnv, fixtureDir} from '../helpers';


/** @test {fileConfigs} */
describe('fileConfigs()', () => {
  const defaultConfig = {region: undefined};
  let fileConfigs = null;

  beforeEach(() => {
    resetEnv();
    fileConfigs = proxyquire('../../src/configs/fileConfigs', {
      'os-homedir': () => path.join(fixtureDir(), 'default')
    });
  });

  afterEach(() => {
    resetEnv();
  });

  it('return default profile config', () => {
    assert.deepEqual(fileConfigs(defaultConfig, AWS), {region: 'ap-northeast-1'});
  });

  it('when env.HOME and env.AWS_CONFIG_FILE doesnot exists return default config', () => {
    fileConfigs = proxyquire('../../src/configs/fileConfigs', {
      'os-homedir': () => null
    });
    assert.deepEqual(fileConfigs(defaultConfig, AWS), {region: undefined});
  });

  it('when default profile doesnot exists in file return default config', () => {
    fileConfigs = proxyquire('../../src/configs/fileConfigs', {
      'os-homedir': () => path.join(fixtureDir(), 'non-default')
    });
    assert.deepEqual(fileConfigs(defaultConfig, AWS), {region: undefined});
  });

  it('when set env.AWS_CONFIG_FILE return config from specific file', () => {
    process.env.AWS_CONFIG_FILE = path.join(fixtureDir(), 'specification-config');
    assert.deepEqual(fileConfigs(defaultConfig, AWS), {region: 'us-west-1'});
  });

  it('when config file doesnot exists return default config', () => {
    fileConfigs = proxyquire('../../src/configs/fileConfigs', {
      'os-homedir': () => path.join(fixtureDir(), 'unknown')
    });
    assert.deepEqual(fileConfigs(defaultConfig, AWS), {region: undefined});
  });

  context('when set env.AWS_PROFILE', () => {
    it('and profile exists in file return specific profile config', () => {
      process.env.AWS_PROFILE = 'customize';
      assert.deepEqual(fileConfigs(defaultConfig, AWS), {region: 'us-east-1'});
    });
    it('and profile doesnot exists in file return default config', () => {
      process.env.AWS_PROFILE = 'unknown';
      assert.deepEqual(fileConfigs(defaultConfig, AWS), {region: undefined});
    });
  });

  it('when apply opts.profile return config using opts.profile', () => {
    assert.deepEqual(
      fileConfigs(defaultConfig, AWS, {profile: 'customize'}),
      {region: 'us-east-1'}
    );
  });

  it('when apply opts.configFile return config from opts.configFile', () => {
    const configFile = path.join(fixtureDir(), 'specification-config');
    assert.deepEqual(
      fileConfigs(defaultConfig, AWS, {configFile}),
      {region: 'us-west-1'}
    );
  });
});

import path from 'path';

import AWS from 'aws-sdk';
import sinon from 'sinon';
import assert from 'power-assert';
import proxyquire from 'proxyquire';

import configProvider from '../src/configProvider';
import environmentConfigs from '../src/configs/environmentConfigs';
import fileConfigs from '../src/configs/fileConfigs';
import {resetEnv, fixtureDir} from './helpers';


/** @test {loader} */
describe('aws-sdk-config-loader', () => {
  let orgConfigKeys = null;
  let loader = null;
  let sandbox = null;
  let stubs = null;

  beforeEach(done => {
    resetEnv();
    process.env.HOME = path.join(fixtureDir(), 'default');
    orgConfigKeys = Object.assign({}, AWS.Config.prototype.keys);
    sandbox = sinon.sandbox.create();
    stubs = {
      configProvider: sandbox.spy(configProvider)
    };
    loader = proxyquire('../src', {
      './configProvider': stubs.configProvider
    });
    done();
  });

  afterEach(done => {
    resetEnv();
    sandbox.restore();
    stubs = null;
    AWS.Config.prototype.keys = orgConfigKeys;
    done();
  });

  it('override AWS.config', () => {
    loader(AWS);
    assert(stubs.configProvider.args.length === 1);
    assert.deepEqual(stubs.configProvider.args[0], [
      AWS,
      [fileConfigs, environmentConfigs],
      {}
    ]);
    assert(AWS.config.region === 'ap-northeast-1');
    assert(AWS.config.credentials.accessKeyId === 'default_key_id');
    assert(AWS.config.credentials.secretAccessKey === 'default_secret_key');
  });

  context('when apply options', () => {
    it('override config and credentials', () => {
      const opts = {profile: 'customize'};
      loader(AWS, opts);
      assert(stubs.configProvider.args.length === 1);
      assert.deepEqual(stubs.configProvider.args[0], [
        AWS,
        [fileConfigs, environmentConfigs],
        opts
      ]);
      assert(AWS.config.region === 'us-east-1');
      assert(AWS.config.credentials.accessKeyId === 'customize_key_id');
      assert(AWS.config.credentials.secretAccessKey === 'customize_secret_key');
    });

    it('and apply noReflectCredentials override only config', () => {
      const opts = {
        profile: 'customize',
        noReflectCredentials: true
      };
      loader(AWS, opts);
      assert(stubs.configProvider.args.length === 1);
      assert.deepEqual(stubs.configProvider.args[0], [
        AWS,
        [fileConfigs, environmentConfigs],
        opts
      ]);
      assert(AWS.config.region === 'us-east-1');
      assert(AWS.config.credentials.accessKeyId === 'default_key_id');
      assert(AWS.config.credentials.secretAccessKey === 'default_secret_key');
    });

    it('and apply noReflectCredentials and throw error', () => {
      const opts = {
        profile: 'customize'
      };
      class StubCredentials {
        get(cb) {
          cb('err');
        }
      }
      sandbox.stub(AWS, 'SharedIniFileCredentials', StubCredentials);
      loader(AWS, opts);
      assert(AWS.config.region === 'us-east-1');
      assert(AWS.config.credentials === null);
    });
  });
});
